import "./Footer.scss";
import { infoData } from "./categories";
import { myPageData } from "./mypage";

const Footer = () => {
  return (
    <footer>
      <div className="footer-content">
        <div className="footer-categories info">
          <div className="title">
              {
                infoData.map(({title}) => {
                  return (
                    <p className="category-title">{title}</p>
                  )
                })
              }
          </div>
              <div className="category">
                {
                  infoData.map(({name}) => {
                    return (
                      <a href="/" className="category-text">{name}</a>
                    )
                  })
                }
              </div>
        </div>
        <div className="footer-categories my-page"></div>
        <div className="footer-categories product-tags"></div>
        <div className="footer-categories follow-us"></div>
      </div>
    </footer>
  );
};

export default Footer;
